import styled from 'styled-components';
export const Div0 = styled.div`
    width: 100%;
    margin: 0 auto;
    height:100%;
    min-width: 1200px;
    display:grid;
    grid-template-columns:65% 1fr;
    grid-gap:20px;

`
export const DataDrawItem = styled.div`
    background-color:white;
    height:80%;
`
